import React, { useState } from "react";
import { Container, Wrapper, Text, Btn } from "./NewAElements.js";
import Select from "react-select";

const options = [
  { value: "company", label: "Company" },
  { value: "smartphones", label: "Smartphones" },
  { value: "laptops", label: "Laptops" },
];

const NewA = () => {
  const [changeone, setchangeone] = useState(false);
  const [changeTwo, setchangeTwo] = useState(false);
  const [changeThree, setchangeThree] = useState(false);

  return (
    <>
      <Container>
        <Wrapper>
          <Text>What are you looking for ?</Text>
          <div style={{ width: "100%", "margin-bottom": "20px" }}>
            <Select
              options={options}
              onChange={() => {
                setchangeone(true);
              }}
            ></Select>
          </div>

          <div
            style={{
              width: "100%",
              "margin-bottom": "20px",
              display: changeone === false ? "none" : "block",
            }}
          >
            <Select
              options={options}
              onChange={() => {
                setchangeTwo(true);
              }}
            ></Select>
          </div>

          <div
            style={{
              width: "100%",
              "margin-bottom": "20px",
              display: changeTwo === false ? "none" : "block",
            }}
          >
            <Select
              options={options}
              onChange={() => {
                setchangeThree(true);
              }}
            ></Select>
          </div>
          <div
            style={{
              width: "100%",
              display: "flex",
              "justify-content": "flex-end",
            }}
          >
            <Btn disabled={changeThree}>Submit</Btn>
          </div>
          <div>
            <label>
              <input
                type="checkbox"
                //checked={checked}
                //onChange={handleChange}
              />
              My Value
            </label>
          </div>
        </Wrapper>
      </Container>
    </>
  );
};

export default NewA;
